Sprite *Sprites::_sprite[Sprites::num_sprites];
M5Canvas *Sprites::_canvas = nullptr;
FFMap *Sprites::_map = nullptr;
M5Canvas *Sprites::_title = nullptr;

Sprites::Sprites()
{
    _canvas = new M5Canvas(&M5.Display);
    _canvas->createSprite(160, 96);
    _canvas->setColorDepth(8);
    for (int i = 0 ; i < num_sprites ; i++)
    {
        _sprite[i] = new Sprite(*_canvas, _sprite_data[i]);
    }
    _map = new FFMap();
    _title = new M5Canvas(&M5.Display);
    _title->createSprite(80,50);
    _title->setColorDepth(8);
    for (int y = 0 ; y < 50 ; y++)
    {
        for (int x = 0 ; x < 80 ; x++)
        {
            _title->setColor(_title_bitmap[x + 80 * y]);
            _title->drawPixel(x, y);
        }
    }
}

Sprites::~Sprites()
{
    delete _map;
    for (int i = 0 ; i < num_sprites ; i++)
    {
        delete _sprite[i];
    }
    delete _canvas;
}

